o pork cubes.  Mix well. Garnish with reserved 2 tablespoons scallions. Yield: 6 to 8 servings.	http://oneperfectbite.blogspot.com/2008/10/crock-pot-asian-style-country-ribs-with.html	\N	black bean sauce\nchicken stock\ncornstarch\ncountry ham\ndark sesame oil\ngarlic\nginger root\nhoney\npepper\npork ribs\nsalt\nscallions\n
