y slice in to see meat has gone from pink to white.</li><li>Remove from grill</li><li>Allow to cool for at least 15 minutes so you don't burn the hell out of yourself cutting it into pieces for your guest(s).</li><li>In the meantime throw those kebabs directly on the grill.</li><li>Flip them over after about 5 minutes to get the other side and allow to cook for another 5-8min.</li><li>Kebabs are done when veggies are al dente (softened but still firm).</li><li>Turn off grill and remove from heat.</li><li>Put rice in a serving dish, and chicken pieces and full skewers on a platter. Squeeze remaining lemon juice over chicken.</li><li>Let people serve themselves.</li><li>Eat, drink and be merry!</li><li>DW | Food and Drink</li></ol>	http://www.foodista.com/recipe/2ZPN8F4S/boozy-bbq-chicken	Foodista.com – The Cooking Encyclopedia Everyone Can Edit	beer\nbeer\nbroccoli\nbrown rice\ncherry\ndijon mustard\nfresh ginger\ngarlic\ngreen bell pepper\nground pepper\nlemon\nlow sodium soy sauce\nmolasses\nmushrooms\nolive oil\norange\norange juice\npepper\nred bell pepper\nred onion\nsalad dressing\nsalt\ntabasco sauce\nwater\nwhite wine\nwhole chicken\nwooden skewers\n
