olded into the egg-banana mixture, add the vegetable oil. And fold that in as well. If you have chopped walnuts, add them here too. I liked my cake with no nuts.</li><li>Pour the batter into the greased and lined baking pan.</li><li>Bake at a pre-heated oven of 160C for standard heating oven, 150C for fan-forced oven for 55 minutes or until the cake turns golden brown. A cake pick or satay stick should come out clean when placed into the centre of the cake. A cake pick or satay stick should come out clean when placed into the centre of the cake.</li><li>Place a cake base or plate over the baking pan and invert the cake over. Peel the baking paper away from the cake.</li><li>Use a cooling rack and invert the cake again. Let the cake cool on the cooling rack. If you are in a dry or cold environment, place a clean towel over the cake as it cools so that it would not dry out too quickly.</li><li>Best served warm.</li></ol>	http://www.foodista.com/recipe/8RBJ4FVM/bing-s-banana-cake	Foodista.com – The Cooking Encyclopedia Everyone Can Edit	baking powder\nbanana\nbananas\nbicarbonate of soda\neggs\nplain flour\nsugar\nwalnuts\n
