r twice baked sweet potatoes!</p>	http://www.pinkwhen.com/brown-butter-twice-baked-sweet-potatoes/	Jen West	avocados\nbuttermilk\ncooked bacon\nfresh parsley\ngoat's cheese\nsalt and pepper\nsour cream\nsweet potatoes\nunsalted butter\n
