568	Healthy Mint Brownies	\N	2021-04-27 14:55:26.919308	2021-04-27 14:55:26.919308	\N	45	<ol><li>Directions:</li><li>Preheat the oven to 350 degrees. Line a 9 by 9 or 7 by 11 baking sheet with parchment paper and set aside.</li><li>Combine the flax, applesauce and almond milk together in a small bowl. Set aside to allow to thicken. In a food processor, combine the blueberries, pear, black beans and oil. Pulse until the mixture become very smooth. Next, add the extracts and process until fully combined. Remove the contents from processor into a medium sized mixing bowl. Add the coconut sugar, cocoa, baking powder, soda, and salt and mix. Add the flour with the chocolate chips and mix until just combined. Pour the batter into your prepared dish and bake at 350 for 44-45 minutes.</li><li>Remove from the oven and allow to cool for at least 50 minutes. If you would like, place the brownies in the fridge for 20 or 30 minutes to speed up cooling time. While the brownies cool, start on your mint filling.</li><li>In a small bowl, combine the soft avocado with full fat coconut milk or heavy cream. Beat on high for about 5 minutes until the mixture is fluffy and smooth. Add the powdered xylitol and mix well. Add peppermint extract and coloring if desired, and beat until all incorporated. Once the mixture is perfectly fluffy and creamy, add the flour and mix until just combined. The mixture should be thick and smooth but still easy to spread. Spread the mixture evenly over the cooled brownies and place in the fridge for 10 minutes, until the mint filling has firmed.</li><li>Next, melt the chocolate. Add the oil to the melted chocolate and stir to combine. Remove the brownies from the fridge and pour the melted chocolate over the brownies, gently and quickly spread the chocolate evenly over the brownies. The mint filling should be cold so the warm chocolate doesnt melt the mint filling, but the chocolate will cool quickly once it touches the cold mint. Make sure to work quickly 