750	Raised Doughnuts	\N	2021-04-27 14:56:47.2192	2021-04-27 14:56:47.2192	https://spoonacular.com/recipeImages/657761-556x370.jpg	300	<ol><li>Dissolve yeast by letting stand 5 minutes in warm water without stirring. In a bowl mix the milk, sugar and salt. Add the dissolved yeast. Then stir in egg and shortening.</li><li>Gradually add flour. As dough becomes stiffer, use hands. Knead until smooth and elastic. Put into lightly greased bowl and cover with a damp cloth. Let rise 2 hours. Punch down and let rise for 1 hour. Roll to 1/3 inch thickness. Cut and let rise 30 to 45 minutes. Leave uncovered so crust will form on top. Slip top side down into fat at 375 degrees. Turn and do not pick with fork. Cook approximately 3 minutes.</li><li>Dip in topping and let cool or shake in a brown paper bag with some powdered sugar.</li></ol>	http://www.foodista.com/recipe/C873JKPX/raised-doughnuts	Foodista.com – The Cooking Encyclopedia Everyone Can Edit	egg\nflour\nmilk\noil\npowdered sugar\nsalt\nshortening\nsugar\nvanilla\nwater\nwater\nyeast\n
743	Chicken Cordon Bleu	\N	2021-04-27 14:56:47.010959	2021-04-27 14:56:47.010959	https://spoonacular.com/recipeImages/638035-556x370.jpg	45	<ol><li>Preheat oven to 350 degrees F.</li><li>Butterfly the chicken breasts by slicing half lengthwise but not cutting all the way through. Lay the halved breasts between 2 pieces of plastic wrap. Using the flat side of a meat mallet, gently pound the chicken to 1/4-inch thickness, taking care to not tear or create holes in the meat.</li><li>Lay 2 slices of cheese on each breast, followed by 2 slices of ham, and 2 more of cheese; leaving a 1/2-inch margin on all sides to help seal the roll. Tuck in the sides of the breast and roll up tight like a jellyroll. Squeeze the log gently to seal.</li><li>Season the flour with salt and pepper; spread out on waxed paper or in a flat dish. Mix the breadcrumbs with thyme, kosher salt, pepper, and oil. The oil will help the crust brown. Beat together the eggs and water, the mixture should be fluid. Lightly dust the chicken with flour, then dip in the egg mixture. Gently coat in the bread crumbs.</li><li>Carefully transfer the roulades to a baking pan and bake for 20 minutes until browned and cooked through.</li><li>Serve whole or cut into pinwheels.</li></ol>	http://www.foodista.com/recipe/KFDCB2XH/chicken-cordon-bleu	Foodista.com – The Cooking Encyclopedia Everyone Can Edit	deli ham\neggs\nflour\nfresh thyme leaves\nkosher salt\nolive oil\npanko bread crumbs\nskinless boneless chicken breasts\nswiss cheese\nwater\n
